import React from 'react';
import CovidInfoBox from './components/CovidInfoBox';
import FormInput from './components/FormInput';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { ResponsivePie } from "@nivo/pie";
import MyResponsiveLine from './components/MyResponsiveLine';


function Dashboard(props) {

  // handle click event of logout button
  const handleLogout = () => {    
    props.history.push('/login');
  }

  return (
    <React.Fragment>
      <div className="h-50">
      <div className=" justify-content-start col-2 ">
        <div> <CovidInfoBox></CovidInfoBox></div>

      <div style={{ height: 550, width:650 , backgroundColor: "#fffff" }}>
      <MyResponsiveLine></MyResponsiveLine>
       </div>
       </div>
      </div>

    </React.Fragment>
  );
}
export default Dashboard;
